const openSideMenu=(e,c,t)=>{const o=document.querySelector(e),d=document.querySelector(c),s=document.querySelector(t);o.addEventListener("click",()=>{s.classList.add("active"),document.body.classList.add("noscroll")}),d.addEventListener("click",()=>{document.body.classList.remove("noscroll"),s.classList.remove("active")})};export default openSideMenu;